import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import Protected from './components/Protected';
import { AuthContextProvider } from './context/AuthContext';
import Account from './pages/Account';
import Home from './pages/Home';
import Signin from './pages/Signin';
import TryFavoris from "./pages/TryFavoris";
import Spanish from "./components/Spanish"
import French from "./components/French";
import Portuguese from "./components/Portuguese";
import Navbar from "./components/Navbar";
import Footer from "./components/footer";

function App() {
    return (
        <div>
            <AuthContextProvider>
                <Navbar />
                <Routes>
                    <Route path='/' element={<Signin />} />
                        <Route protected path='/Home' element={<Home />} />
                        <Route path="/Spanish" element={<Spanish />} />
                        <Route path="/French" element={<French/>} />
                        <Route path="/Portuguese" element={<Portuguese/>} />
                        <Route path="/TryFavoris" element={<TryFavoris/>} />
                        <Route path='/account' element={<Account />} />

                </Routes>
            </AuthContextProvider>
            <Footer />
        </div>
    );
}

export default App;
